import React, { useEffect, useState } from 'react';
import axios from 'axios';

const ListarFornecedores = () => {
  const [fornecedores, setFornecedores] = useState([]);

  useEffect(() => {
    const fetchFornecedores = async () => {
      try {
        const response = await axios.get('http://127.0.0.1:8003/v1/api/fornecedores');
        setFornecedores(response.data);
      } catch (error) {
        console.error('Erro ao buscar fornecedores', error);
      }
    };

    fetchFornecedores();
  }, []);

  return (
    <div>
      <h1>Lista de Fornecedores</h1>
      <ul>
        {fornecedores.map((fornecedor) => (
          <li key={fornecedor.id}>
            <p>Nome: {fornecedor.nome}</p>
            <p>Email: {fornecedor.email}</p>
            <p>Telefone: {fornecedor.telefone}</p>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default ListarFornecedores;
